import React, { FC } from "react";
import { Mod } from "../models/Mod";
import { Modes } from "../models/Modes";

interface DebutProps {
    title: string;
    debuts: string[];
    children?: string;
    mod: Mod;
}

const click = (mod: Mod) => {
    mod.mod = Modes.CLICK
}

const DebutsMake: FC<DebutProps> = ({title, debuts, children, mod}) => {
    return (
        <p className = "debuts">
            <h3>{title}</h3>
            {debuts.map(debut => 
                <p key={1}>
                    <button>{debut}</button>
                </p>
            )}
            <button onClick={() => click(mod)}>{children}</button>
        </p>
    );
};

export default DebutsMake;
